/** @format */

import React, { Component } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import Order from './components/Order';

class App extends Component {
    render() {
        const data = [
            {
                type: 'burger',
                quantity: 2,
            },
            {
                type: 'soda',
                quantity: 2,
            },
        ];
        return <Order sku={1} order={data} status='Pending'></Order>;
    }
}
export default App;
